  false,\n\t\"url\": null,\n\t\"notes\": \"TASK NAME: Lake Erie LiDAR Priority Area
  1 LiDAR Data Acquisition and Processing Production Task- Jackson, Hillsdale, and
  Lenawee Counties USGS Contract No. G10PC00057 Task Order No: G10PD02054 Woolpert
  ORDER NUMBER: 70398 CONTRACTOR: Woolpert, Inc. LiDAR data is a remotely sensed high
  resolution elevation data collected by an airborne platform. The LiDAR sensor uses
  a combination of laser range finding, GPS positioning, and inertial measurment technologies.
  The LiDAR systems collect data point clouds that are used to produce highly detailed
  Digital Elevation Models (DEMs) of the earth's terrain, man-made structures, and
  vegetation. The task required the LiDAR data to be collected at a resolution of
  0.44 points per square meter (PPSM). The final products include first, last, and
  at least one intermediate return LAS, full classified LAS and a bare earth model
  in separate files.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
